import React, { Component } from "react";
import SingleBook from "./SingleBook";

const Shelf = (props) => {
  return (
    <ol className="books-grid">
      {props.shelfBooks.map((book) => (
        <SingleBook
          key={book.id}
          book={book}
          updateShelf={props.updateShelf}
        />
      ))}
    </ol>
  );
};

export default Shelf;
